import Accordion from "react-bootstrap/Accordion";
import "./accord.css";
export default function Accord({ props }) {
  console.log(props);
  return (
    <Accordion defaultActiveKey="0">
  <Accordion.Item eventKey="0">
    <Accordion.Header>Accordion Item #1</Accordion.Header>
    <Accordion.Body>
      {props.desc}
    </Accordion.Body>
  </Accordion.Item>
  </Accordion>
  );
}
